import React from 'react';
import LessonList from './lessonList';

function Lesson(){
    const lessons = [
        { id: 1, name: '数学课', description: '基本数学概念和计算技巧'},
        { id: 2, name: '物理课', description: '力学和电学的基础知识' },
        { id: 3, name: '化学课', description: '化学元素和反应' },
    ];
    
    return (
        <div className='app-container'>
            <h3>课堂列表</h3>
            <LessonList lessons={lessons} />
        </div>
    );
}



export default Lesson;
